export default function sketch(p){
    p.setup = () => {
        p.createCanvas(p.windowWidth, p.windowHeight)
    }

    p.draw = () => {
        p.background(255, 100, 100);
        this.helper();
    }

    p.helper = function(){
        console.log("helper")
    }
}
